Two very different men join forces to unravel the mystery of a &quot;Stargate,&quot; 
an ancient human transmitter, discovered in the Egyptian desert. Once activated, it enables scientists and the military
to travel light years from earth, to a strange and alien world, where the visitors must overcome an enigmatic ruler.


Kurt Russell ... Colonel Jonathan O'Neil
James Spader ... Dr. Daniel Jackson
Alexis Cruz ... Skaara
Viveca Lindfors ... Catherine
Mili Avital ... Sha`uri
Leon Rippy ... General West
John Diehl ... Lt. Kawalsky
Carlos Lauchu ... Anubis
Jaye Davidson ... Ra
